(4, 'RED ALOE VERA JUICE', 'red-aloe-vera-juice', NULL, 2, 'IMG_4.jpg', NULL, '<h4 class=\"mb-5 mt-3 fw-bold\">&nbsp;</h4>\r\n<p class=\"mb-3 fs-15\">ALOE VERA JUICE BENEFITS</p>\r\n<p class=\"mb-3 fs-15\">1. Help in constipation.</p>\r\n<p class=\"mb-3 fs-15\">2. Helps boost immunity.</p>\r\n<p class=\"mb-3 fs-15\">3. Supports liver health.</p>\r\n<p class=\"mb-3 fs-15\">4. Helps combat skin allergies.</p>\r\n<p class=\"mb-3 fs-15\">5. Helps build up a healthy digestive system.</p>\r\n<p class=\"mb-3 fs-15\">6. Helps reduce fat and tones your body.</p>\r\n<p class=\"mb-3 fs-15\">7. Effective for people suffering from joint pain.</p>\r\n<p class=\"mb-3 fs-15\">8. Helps rejuvenate skin &amp; promotes healthy hair.</p>\r\n<p class=\"mb-3 fs-15\">INGREDIENTS: Pure aloe vera juice ,Neem,Tulsi, Giloy juice ,permitted class 2 preservative &amp; citric acid Q.S..,</p>\r\n<p class=\"mb-3 fs-15\">DIRECTION FOR USE: Take 30ml of Aloe vera juice mixed with equal amoount of lukewarm water twice daily before meals or as directed by the physician.</p>\r\n<p class=\"mb-3 fs-15\">1. Shake well befor use.</p>\r\n<p class=\"mb-3 fs-15\">2. consume within 1 month from the opening cap.</p>\r\n<p class=\"mb-3 fs-15\">3. Keep in a cool ,dry place and away from direct sun light.. USER,S</p>\r\n<p class=\"mb-3 fs-15\">NOTICE: Due to natural ingredients the colour, taste and consistency may very with sesonal variation without affection purity , efficiency and quality.</p>', 'true', NULL, NULL, NULL, '2022-04-02 01:20:42', '2022-04-02 01:21:11'),
(5, 'PRANDEY GHOL', 'pure honey , long pepper & Tulsi leaf.', NULL, 2, 'IMG_5.jpg', NULL, '<p>High quality honey &mdash; which is minimally processed, unheated, and fresh &mdash; contains many important bioactive plant compounds and antioxidants, such as flavonoids and phenolic acids. Darker varieties tend to offer more antioxidants than lighter varieties (2Trusted Source). Antioxidants help neutralize reactive oxygen species (ROS) in your body, which can build up in cells and cause damage. This damage can contribute to conditions like premature aging, type 2 diabetes, and heart disease (2Trusted Source). As such, many of honey&rsquo;s health benefits are attributed to its antioxidant content.&nbsp;</p>', 'true', NULL, NULL, NULL, '2022-04-02 01:24:35', '2022-04-02 01:24:42'),
(6, 'TRIPHALA JUICE', 'HARDI ,BEHRA ,AAWLA.', NULL, 2, 'IMG_6.jpg', NULL, '<p><strong>Amazing</strong> Health Benefits of Triphala Juice Aids Weight Loss: This Triphala juice is a perfect recipe for weight loss. It aids in fat loss around the belly area and thereby reducing your weight. Ayurvedic Triphala Juice contains the natural properties of Amla, Haritaki &amp; Bahera that are rich in antioxidants. It flushes out unwanted chemicals and unbroken waste from body. Dental Health: Our organic Triphala juice has antimicrobial and anti-inflammatory properties that can help prevent plaque formation, which is a common cause of cavities and Gingivitis (gum inflammation). Drinking this natural juice reduces bacterial growth in the mouth thereby keeping plaque build up in check. This product also controls bad breath as it removes germs from the mouth. Triphala Builds Immunity: Triphala has powerful natural compounds which is a strong immunity booster. It aids in metabolism and helps in cleaning of colon. Consumption of our natural triphala juice helps in control of blood sugar and it purifies the blood by removing the impurities. Apart from aiding in weight loss, it is a natural purifier of all toxic ingredients found in stomach, liver and intestines.</p>', 'true', NULL, NULL, NULL, '2022-04-02 01:27:35', '2022-04-02 01:27:41'),
(7, 'AAROGYA CHURAN', 'MORINGA POWDER', NULL, 2, 'IMG_7.jpg', NULL, '<h1 class=\"a-size-base-plus a-text-bold\">About this item</h1>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-mini\">\r\n<li><span class=\"a-list-item\"> 17 times more calcium than that of milk </span></li>\r\n<li><span class=\"a-list-item\"> 25 times more iron than that of Spinach </span></li>\r\n<li><span class=\"a-list-item\"> A rich source of Vitamin C </span></li>\r\n<li><span class=\"a-list-item\"> An excellent source of Amino acids (Amino acids form proteins) </span></li>\r\n<li><span class=\"a-list-item\"> Boosts overall energy level </span></li>\r\n<li><span class=\"a-list-item\"> Increases stamina &amp; vitality </span></li>\r\n<li><span class=\"a-list-item\"> Naturally restores essential vitamin &amp; mineral imbalances </span></li>\r\n</ul>', 'true', NULL, NULL, NULL, '2022-04-02 02:25:07', '2022-04-02 02:26:41'),
(8, 'KASTURI CHURAN', 'SHILAJIT,SWET MUSALI,KONS BEEJ,ASHVGANDHA.', NULL, 2, 'IMG_8.jpg', NULL, '<p><strong>Vijaysree kasturi churan&nbsp;</strong>useful is can function as an antioxidant to improve your body\'s immunity and memory,diabetes calm the brain, reduce swelling, lower Blood pressure.</p>\r\n<p><strong>Ingredients: </strong>Shilajit, safed musli, kaunch &amp; Ashwagandha powder.</p>\r\n<p><strong>Dosage : </strong>Use 2-3 tea spoon kasturi churan with lukewarm water before take meal or accoring to physician.</p>', 'true', NULL, NULL, NULL, '2022-04-13 09:29:11', '2022-04-13 09:29:19');
