INSERT INTO `pages` (`id`, `name`, `slug`, `image`, `excerpt`, `description`, `seo_title`, `seo_keywords`, `seo_description`, `page_under`, `created_at`, `updated_at`) VALUES
(1, 'About Us', 'about-us', 'IMG_1.jpg', '<p>That M/s <strong>VIJAYSREE RK PRAVITE LIMITED</strong> a Company incorporated under the Companies Act, 2013 ,{Incorporation rules 2014} having its Registration No. CIN- U24290RJ2022PTC079508 and Registered Office at 114 NH Highway jodhpur -jaisalmer road Dechu, jodhpur (342314) JODHPUR RAJSATHAN, hereinafter referred to as the Company. We have taken immense pleasure in introducing first ever Retail concept with maximum benefit for customers. The Company is engaged into the business of direct selling through its Direct Seller and Retail Outlets as stated in the Object Clauses of memorandum of Association of the Company.</p>\r\n<p>We are building up people with a focus on empowering employees each day. Our Vision is to discover a product line and business opportunity that improves people\'s lives every day.</p>', '<h1><span style=\"color: #100f15;\">We Help to Build Your Dream Project. </span></h1>\r\n<p>&nbsp;</p>\r\n<p>That M/s VIJAYSREE RK PRAVITE LIMITED a Company incorporated under the Companies Act, 2013 ,{Incorporation rules 2014} having its Registration No. CIN- U24290RJ2022PTC079508 and Registered Office at 114 NH Highway jodhpur -jaisalmer road Dechu,jodhpur(342314)JODHPUR RAJSATHAN,&nbsp;hereinafter referred to as the Company. We have taken immense pleasure in introducing first ever Retail concept with maximum benefit for customers. The Company is engaged into the business of direct selling through its Direct Seller and Retail Outlets as stated in the Object Clauses of memorandum of Association of the Company.</p>\r\n<p>The company having GST/ Income Tax, TDS and other license as may be required as per the law/regulation/Guideline of its principle place of Business and GST and other license for each retail outlets at various states in India. The company is also having own trademark to promote own manufactured products for sale/ direct selling business and trademark identifies the company with the goods to be sold or supplied. Our company is engaged in the manufacturing of the products &amp; the Business of Direct selling. Direct selling refers to selling products directly to the consumer in a non-retail environment. Instead, sales occur at home, work, or other non store location.</p>\r\n<p>This system often eliminates several of the middlemen involved in product distribution, such as the regional distribution centre and wholesaler. Instead, products go from manufacturer to the direct sales company, to the distributor or representative, and to the consumer. The products sold through direct sales are usually not found in typical retail locations, which means finding a distributor or representative is the only method to buy the products or services. All the sales was done by through its sales agent i.e Direct sellers and middleman commission was given to the Direct sellers/sales agent during the considering year.</p>\r\n<p>For smooth running the business of direct selling, Company has certain rules and regulation, mathematically calculated Business plan and other terms and conditions. Now in order to simplify more, to keep more transparent, to control the fraudulent practices and for betterment of the activities of direct selling through its direct selling marketing, Company is using better trading plan and mathematically calculated Business plan to promote the sale of the company\'s products.</p>\r\n<p>The Company exclusively uses their website and Retail Outlet to display the details about products, products information, product quality certificate, price, complete mathematically calculated Business plan , marketing methods, business monitoring, information regarding management while uses the word of mouth publicity to promote and create awareness about the website and its products.</p>\r\n<p>An Individual / Firm / Company who is able to do contract as per the provision of The Indian Contract Act,(18 OF 2013)<strong>i</strong> and wish to become direct seller of the company, can apply to be appointed as a Direct seller to marketing and selling of company\'s product in whole of India, in prescribed form through online/manual. There is No deposit or any charges/enrolment fees/joining fees/renewal charges for becoming a Direct Seller of the Company</p>\r\n<p>DO NOT FOLLOW THE MAJORITY, FOLLOW THE RIGHT WAY.</p>\r\n<p>VIJAYSREE RK PRIVATE LIMITED.</p>\r\n<p>We are building up people with a focus on empowering employees each day. Our Vision is to discover a product line and business opportunity that improves people\'s lives every day.</p>', NULL, NULL, NULL, 0, '2022-01-26 23:27:54', '2022-04-03 23:32:00'),
(2, 'Term & Condition', 'term-condition', 'IMG_2.jpg', 'please follow all terms and condition of company', '<h2><strong style=\"color: rgb(230, 0, 0);\" class=\"ql-size-huge\">Term &amp; Condition</strong></h2><p><strong style=\"color: rgb(230, 0, 0);\"> </strong></p><p>1. I assume that the company is product based and I am buying the product on my own volition.</p><p>2. I know that the company does not have any investment plan.</p><p>3. Nobody forced me.</p><p>4. All the information entered in the ID is correct.</p><p>5. The company does not accept any advance.</p><p>6. Make the payment of the company on the company\'s website only. </p><p>7. The company does not take re-entry payment in any way, if anyone has a lamp, then the company will not be responsible.</p><p>8. If I violate the terms and conditions of the company, then I will accept the action taken by the company.</p><p>9. If I misbehave with the company, I will give the right to have my ID terminated. </p><p>10. I will not give any kind of pressure or threat to the company from any political, social and media.</p><p>11. I accept all the above terms and conditions and the plan of the company, and I will work honestly in the company.</p>', NULL, NULL, NULL, 0, '2022-02-04 06:01:17', '2022-02-28 12:21:59'),
(3, 'Privacy policy', 'privacy-policy', 'IMG_3.jpg', '<p>Company privacy</p>', '<p><strong class=\"ql-size-huge\" style=\"color: #0066cc;\"> Privacy Policy</strong></p>\r\n<p>&nbsp;</p>\r\n<p>1. Please do not share your ID and Password with anyone</p>\r\n<p>2. Register your group member yourself.</p>\r\n<p>3. Do not share OTP, PIN and personal information to anyone.</p>\r\n<p>4. Keep these things in mind and follow the terms and conditions of the company.</p>\r\n<p>5. You will be responsible for your own safety.</p>', NULL, NULL, NULL, 0, '2022-02-24 15:08:41', '2022-03-12 18:14:13'),
(4, 'Vision & mission', 'vision-mission', 'IMG_4.jpg', NULL, '<p><em class=\"ql-size-large\" style=\"color: rgb(255, 255, 0); background-color: rgb(0, 0, 0);\">OUR MISSION AND VISION</em></p><p><br></p><p>Our MISSION is to contribute to the global community through the Help of Mankind. We do this by helping individuals achieve their goals and lead better lives through a combination of an entrepreneurial business opportunity with life-enhancing products. Our VISION is to be the global Health leader within the direct selling business, leveraging this position so as to be a positive influence in the development of sustainable and professional direct selling communities around the world.</p><p><br></p><p>Our CORE VALUES are Health, Safety &amp; Financial freedom.</p><p>Health: People are our greatest assets. We are committed to provide best in class health product to enrich your health.</p><p>Safety: Safety from various illness and with may appear due to deficiency of food vitamins and minerals, out quality products give you the power to fight from various normal and abnormal health issues, we are also having a range of safety product which help you to save people life and with unexpected life accidents.</p><p>Financial freedom: We provide such and business opportunity at you convenience by which one can earn as much as one wanted, doing this business make you enable to fulfil all your dreams.</p><p>This is the VIJAYSREERK Pledge to you.</p><p>ABSOLUTE LIVING</p><p>Modern life has made it possible for us to enjoy a lifestyle of increasing convenience. Everything is accessible and available at our fingertips and we are connected now more than we ever were. But along with these advancements come a whole new downward spiral – rapidly declining health.</p><p>As we lead our newly acquired fast-paced lives, we subject ourselves to all kinds of pollution, harmful diets, sedentary habits, and stress. As a result, our physical and mental health suffers, and this takes a toll on all aspects of our lives.</p><p>Fortunately, it’s not too late. There is still time to take control and start living better – by shifting to a more balanced lifestyle that embraces a more positive and proactive approach to health and wellness.</p><p><br></p><p>This is the VIJAYSREERK concept of Absolute Living.</p><p><br></p><p>VIJAYSREERK products and services have the overarching goal of making complete wellbeing accessible to all. By wholeheartedly joining VIJAYSREERK, help you achieve a balanced life with a healthier body, mind, and spirit.</p><p><br></p><p>By pledging allegiance to VIJAYSREERK products and services, you not only unearth a whole new level of health and wellness – You will discover a whole new in YOU..!!</p><p><br></p><p><br></p><p>Success in not the key to happiness. Happiness is the key to success. If you love what you are doing, You will be successful.</p><p><br></p><p>VIJAYSREE RK PRIVATE LIMITED .</p><p><br></p><p>We are building up people with a focus on empowering employees each day. Our Vision is to discover a product line and business opportunity that improves people\'s lives every day.</p><p><br></p><p>Latest News</p><p><br></p><p>Contact Us</p><p>Address</p><p>NH 114 JODHPUR -JAISALMER DECHU JODHPUR(342314) RAJSATHAN INDIA</p><p><br></p><p>Email Us</p><p>info@vijaysreerk.com</p><p><br></p><p>Call Us</p><p>+91 9511308894</p><p><br></p><p>Landline No.</p><p><br></p><p>(COOMING SOON)</p><p><br></p><p>CIN No.</p><p>U74999RJ2017PTC058714</p><p><br></p><p>GST No.</p><p>(08AAICV5416C1ZF)</p><p><br></p><p>Quick Links</p><p>&nbsp;&nbsp;Home</p><p>&nbsp;Order</p><p>&nbsp;Members</p><p>&nbsp;Wallet History</p><p>&nbsp;Income</p><p>&nbsp;Debit Request</p><p>&nbsp;Support</p><p>Contact us</p><p>Reward</p><p>© 2022 Vijaysree Rk Pvt. Ltd. | All Rights Reserved</p>', NULL, NULL, NULL, 1, '2022-02-24 15:47:47', '2022-03-03 10:38:31'),
(5, 'Directors Massage', 'directors-massage', 'IMG_5.jpg', NULL, '<h2>Director Message</h2>\r\n<p>&nbsp;</p>\r\n<p><strong>Greeting from VIJAYSREERK</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Thanks for a very warm shake hand. We want to thank all of you &amp; welcome you in \"VIJAYSREE RK PRIVATE LIMITED.\", One of the fastest growing health &amp; Wellness Company. As you know that health sector is a billion dollar industry but health and wellness is a trillion dollar industry, therefore we have started VRK with a vision of a healthy India &amp; wealthy India.</p>\r\n<p>VRK is engaged in world class Ayurvedic wellness products &amp; marketing of such products by direct marketing methods. We are committed to help people live a life of economic freedom on their own terms. As you know the entire management professionals in VRK are very successful &amp; having huge experience in direct selling industry so you can be rest assured that your health &amp; wealth is in very safe hands and VRK is going to be a win-win business for you.</p>\r\n<p>Dear friends, let\'s grow and create a benchmark in direct selling with team spirit.</p>\r\n<p>We wish you good luck</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Director </strong></p>\r\n<p>VIJAYSREE RK COMPANY</p>', NULL, NULL, NULL, 1, '2022-02-24 15:48:49', '2022-04-03 23:33:00'),
(6, 'About Company', 'about-company', 'IMG_6.jpg', '<p>OUR DECISION OUR FUTURE</p>', '<p><span class=\"ql-size-large\">COMPANY PROFILE </span></p>\r\n<p>WE VIJAYSREE RK PRIVATE LIMITED IS A NEW BORN CONCEPT OF THE&nbsp; WELLNESS PRODUCTS .THE COMPANY IS SUCCESSFUL RUNNING IN INDIA WITH TRUST.</p>\r\n<p>THE VIJAYSREE RK PRIVATE LIMITED IS PROFESSIONALLY MANAGED BY THE NEW GENERATION TEAM OF RK BRAND IN THE DIRECT SELLING INDUSTRY. WHICH IS A PROVEN MARKETING CONCEPT GLOBALLY.</p>', NULL, NULL, NULL, 1, '2022-02-24 15:49:36', '2022-03-18 16:34:24'),
(7, 'Refund & cancellation policy', 'refund-policy', 'IMG_7.jpg', '<p>If for any reason you do not like the product given by us, you can refund it, but for that follow the following conditions.<br />1 The product must be in the same condition as it is delivered to you.<br />2 The company will not accept&nbsp; loose products.<br />3 Return the product within 10 days of delivery.<br />Follow all these rules.</p>\r\n<p>Refund will be completed in 7 to 10 working days as per rules after receiving the request from you. And refund and credit the amount to the customers bank account. in 7 to 10 working days.</p>', '<p><strong>Refund &amp; cancellation policy: </strong></p>\r\n<p>If for any reason you do not like the product given by us, you can refund it, but for that follow the following conditions.</p>\r\n<p>1. Ensure that all products are returned unopened and in their original packaging.</p>\r\n<p>2. Must have:</p>\r\n<ul>\r\n<li>Product images, taken on delivery time.</li>\r\n<li>Authorization number</li>\r\n<li>Purchase receipt</li>\r\n<li>Shipping address</li>\r\n</ul>\r\n<p><br />3. The product must be in the same condition as it is delivered to you.</p>\r\n<p><br />4.&nbsp; The company will not accept&nbsp; loose products.</p>\r\n<p><br />5.&nbsp; Return the product within 10 days of delivery.</p>\r\n<p>Follow all these rules, Refund will be completed in 7 to 10 working days as per rules after receiving the request from you. And refund and credit the amount to the customers bank account in 7 to 10 working days.</p>', NULL, NULL, NULL, 2, '2022-02-24 15:50:25', '2022-04-03 21:13:15');
