(10, 'Pan card', 'vijaysree-rk-private-limited-pen-card', 'IMG_10.jpg', NULL, '<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" /></p>', NULL, NULL, NULL, 2, '2022-03-01 19:28:23', '2022-03-22 11:53:23'),
(17, 'Shipping Policy', 'shipping-policy', NULL, '<p>After purchasing the product your delivery will reach your doorstep after 7 to 10 working days. For delivery related information call on the helpline number 9511308894</p>\r\n<p>And more information on our website <span style=\"background-color: #3598db;\">vijaysreerk.com</span></p>\r\n<p>contact mail - info@vijaysreerk.com</p>', '<p><u>For International buyers:</u></p>\r\n<p><strong>You can Place order (Self / Gifting) for delivery within INDIA</strong>. We Do Not Ship outside India.</p>\r\n<p><strong><u>For domestic buyers:</u></strong></p>\r\n<ul>\r\n<li>Orders are shipped through registered domestic courier companies and /or speed post only.</li>\r\n<li>Orders are shipped within 7 working days or as per the delivery date agreed at the time of order confirmation and delivering of the shipment subject to Courier Company / post office norms.</li>\r\n<li><a href=\"../../../\" target=\"_blank\" rel=\"noopener\">Vijaysreerk</a> is not liable for any delay in delivery by the courier company / postal authorities and only guarantees to hand over the consignment to the courier company or postal authorities within 7 working days from the date of the order and payment or as per the delivery date agreed at the time of order confirmation.</li>\r\n<li>To ensure safe and fast delivery of the products, we ship through reputed courier partners.</li>\r\n<li>If you feel that the packing is tampered before the delivery of the product, kindly reject the package and inform our customer care, mentioning your order reference number. We shall make our best efforts to ensure that a replacement delivery is made to you at the earliest.</li>\r\n<li>Delivery of all orders will be to registered address of the buyer as per the credit/debit card only at all times (Unless specified at the time of Order). Vijaysreerk is in no way responsible for any damage to the order while in transit to the buyer.</li>\r\n</ul>\r\n<p><strong><u>Payments:</u></strong></p>\r\n<p><a href=\"../../../\" target=\"_blank\" rel=\"noopener\">https://vijaysreerk.com</a> is proud to use<strong> Payu Payment Gateway</strong> for fast, easy and efficient secure payments. All major credit cards are accepted.</p>\r\n<p><strong>Free Delivery :</strong></p>\r\n<p><strong>1.&nbsp; Every orders shipped by <a href=\"../../../\" target=\"_blank\" rel=\"noopener\">https://vijaysreerk.com</a> are delivered Free through out India.</strong></p>\r\n<p><strong>2.&nbsp; </strong>For shipments outside Rajasthan(Within India) Octroi charges (if any), has to be borne by the&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; customer.</p>\r\n<p><strong>Cash on Delivery (C-o-D</strong><span style=\"color: #333333; font-family: \'lucida grande\', tahoma, verdana, arial, sans-serif; font-size: 13px; line-height: 19px; text-align: justify; word-spacing: 2px;\">)&nbsp;</span><strong>:</strong></p>\r\n<p>1. Cash on Delivery options are not available.</p>\r\n<p><strong>About payment gateway</strong>:</p>\r\n<p>1. All Payments at <a href=\"../../../\" target=\"_blank\" rel=\"noopener\">https://vijaysreerk.com</a> are protected with 128Bit SSL Encryption which is the highest Level of Protection in Payment Gateways hence keeping your Payment Safe &amp; Secure.</p>\r\n<p>2. We use Payu payment gateway for all our Payments for Credit / Debit Cards and Net Banking.</p>\r\n<p><strong>10 Days Replacement Guarantee :</strong></p>\r\n<p>1. Any Products purchased from <a href=\"../../../\">https://vijaysreerk.com</a> carries 10 days Replacement guarantee against any Manufacturer Defects.</p>\r\n<p><strong>And for more information: </strong></p>\r\n<p>Contact mail - <a href=\"mailto:info@vijaysreerk.com\">info@vijaysreerk.com</a></p>\r\n<p>Mobile no. - +91-9511308894</p>', NULL, NULL, NULL, 2, '2022-03-07 15:02:09', '2022-04-12 20:14:24');
