(3, 'TRIPHALA JUICE', 'triphala-juice-nutural-and-100-percent-pure', NULL, 'please continue use and check ruselts.', '<p><strong>Amazing</strong> Health Benefits of Triphala Juice Aids Weight Loss: This Triphala juice is a perfect recipe for weight loss. It aids in fat loss around the belly area and thereby reducing your weight. Ayurvedic Triphala Juice contains the natural properties of Amla, Haritaki &amp; Bahera that are rich in antioxidants. It flushes out unwanted chemicals and unbroken waste from body. Dental Health: Our organic Triphala juice has antimicrobial and anti-inflammatory properties that can help prevent plaque formation, which is a common cause of cavities and Gingivitis (gum inflammation). Drinking this natural juice reduces bacterial growth in the mouth thereby keeping plaque build up in check. This product also controls bad breath as it removes germs from the mouth. Triphala Builds Immunity: Triphala has powerful natural compounds which is a strong immunity booster. It aids in metabolism and helps in cleaning of colon. Consumption of our natural triphala juice helps in control of blood sugar and it purifies the blood by removing the impurities. Apart from aiding in weight loss, it is a natural purifier of all toxic ingredients found in stomach, liver and intestines.</p>', '460', NULL, NULL, 'true', NULL, NULL, NULL, '2022-02-25 21:54:58', '2022-04-14 11:50:07'),
(5, 'PRANDEY GHOL', 'pure-honey-long-pepper-tulsi-leaf', NULL, 'Studies suggest that honey might offer antidepressant, anticonvulsant and anti-anxiety benefits. In some studies, honey has been shown to help prevent memory disorders. Wound care. Topical use of medical-grade honey has been shown to promote wound healing, particularly in burns.', '<p>High quality honey &mdash; which is minimally processed, unheated, and fresh &mdash; contains many important bioactive plant compounds and antioxidants, such as flavonoids and phenolic acids. Darker varieties tend to offer more antioxidants than lighter varieties (2Trusted Source). Antioxidants help neutralize reactive oxygen species (ROS) in your body, which can build up in cells and cause damage. This damage can contribute to conditions like premature aging, type 2 diabetes, and heart disease (2Trusted Source). As such, many of honey&rsquo;s health benefits are attributed to its antioxidant content.</p>', '535', NULL, NULL, 'true', NULL, NULL, NULL, '2022-03-01 22:46:46', '2022-04-14 11:31:31'),
(6, 'ORTHO CARE JUICR', 'joint-pain', NULL, NULL, '<div class=\"promo-container--full-bleed grid rio-base__container-section PRODUCT\">\r\n<div id=\"HOWTOUSE\">\r\n<div class=\"grid--align-self-stretch grid--justify-center grid--align-center grid--direction-column ng-isolate-scope\">\r\n<div class=\"flex grid--direction-column price-details\">\r\n<div class=\"product-content-desc lybText--dark\">Ortho care juice is a perfect combination of ayurvedic herbs that vanishes pain and makes your bones healthier and stronger.</div>\r\n<div>\r\n<div class=\"product-content-expiry\">\r\n<ul style=\"list-style-type: circle;\">\r\n<li class=\"lybText--tiny lybText--dark\">Expiry Date: 30-Sep-2022</li>\r\n<li class=\"lybText--tiny lybText--dark\">₹100 shipping charges applicable</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"lybPad-top--half\">&nbsp;</div>\r\n<h2 class=\"grid--direction-row rio-base__container-section__header lybText--baseline\"><strong>Payable by online payments only&nbsp;</strong></h2>\r\n<h2 class=\"grid--direction-row rio-base__container-section__header lybText--baseline\"><strong>How to use?</strong></h2>\r\n<div class=\"grid__col-20 grid--direction-row rio-base__container-section__subtext grid--justify-start\">\r\n<p><strong> For Ortho Care Juice :</strong> <br />1. Take 15 to 30ml of Nutriorg Ortho Care Juice and mix it with a glass of lukewarm/normal water. <br />2. For best results, it is advised to consume this juice regularly for 6 months. <br /><br /><strong> For Nutriorg Hand Sanitizer : </strong> <br />Apply a sufficient amount on your palms, spread and rub on the back of your hands and fingertips until dry. <br /><br /><strong> Hand Sanitizers are most effective when: </strong> <br /><br /><strong>1. Don&rsquo;t Use Hand Sanitizer on soiled hands: </strong> Hand sanitizers are not meant to clean your hands. They are meant to disinfect. Residue like oil or dirt will prevent hand sanitizers from penetrating down to your skin and will leave it ineffective. <br /><br /><strong>2. Use sufficiently: </strong> When it comes to hand sanitizer, less is not more. You need to apply enough to thoroughly coat every part of your hands. Don&rsquo;t forget about the back of them or your fingers! <br /><br /><strong>3. Rub until dry:</strong> This will make the alcohol work faster and evaporate out disinfecting your hands thoroughly. <br /><br />It contains Aloe vera, Tea-tree Oil, Lemon, Neem, Tulsi and Mint that takes care of your skin. The Sanitizer does the perfect job without harming your skin each time it is being used. The Nutriorg Ayurvedic Hand Sanitizer can be used innumerable times without worrying about the side effects of Alcohol.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"promo-container--full-bleed grid rio-base__container-section PRODUCT\">\r\n<div id=\"FAQs\">\r\n<div class=\"grid--align-self-stretch grid--justify-center grid--align-center grid--direction-column ng-isolate-scope\">\r\n<div class=\"promo-container--full-bleed grid rio-base__container-section PRODUCT\">\r\n<div id=\"FAQs\">\r\n<div class=\"grid--align-self-stretch grid--justify-center grid--align-center grid--direction-column ng-isolate-scope\">\r\n<h2 class=\"grid--direction-row rio-base__container-section__header lybText--baseline\"><strong>Frequently Asked Questions</strong></h2>\r\n<div class=\"grid__col-20 grid--direction-row rio-base__container-section__subtext grid--justify-start\">\r\n<p><strong>1.How to store Nutriorg Ortho care juice?</strong> <br />The shelf life for this product is 18 months. Once the juice is opened, it is advised to store it in the refrigerator. <br /><br /><strong>2. Does the product contain any chemical ingredients?</strong> <br />No, the product does not contain any chemical ingredients. <br /><br /><strong>3. How many days does the product take to show the result?</strong> <br />It works slowly and shows the result within a month if consumed regularly.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', '495', NULL, NULL, 'true', NULL, NULL, NULL, '2022-03-01 22:52:23', '2022-05-28 15:43:20'),
