(13, 'RED ALOE VERA JUICE', 'aloe-vera-with-mango-flewar', NULL, NULL, '<p>Description :<br />ALOE VERA JUICE BENEFITS 1. Help in constipation. 2. Helps boost immunity. 3. Supports liver health. 4. Helps combat skin allergies. 5. Helps build up a healthy digestive system. 6. Helps reduce fat and tones your body. 7. Effective for people suffering from joint pain. 8. Helps rejuvenate skin &amp; promotes healthy hair. INGREDIENTS: Pure aloe vera juice ,Neem,Tulsi, Giloy juice ,permitted class 2 preservative &amp; citric acid Q.S.., DIRECTION FOR USE: Take 30ml of Aloe vera juice mixed with equal amoount of lukewarm water twice daily before meals or as directed by the physician. 1. Shake well befor use. 2. consume within 1 month from the opening cap. 3. Keep in a cool ,dry place and away from direct sun light.. USER,S NOTICE: Due to natural ingredients the colour, taste and consistency may very with sesonal variation without affection purity , efficiency and quality.</p>', '450', NULL, NULL, 'true', NULL, NULL, NULL, '2022-04-02 01:33:53', '2022-06-17 16:26:14');
